import * as React from "react"
import Svg, { Image } from "react-native-svg"

export function FilledStar(props) {
  return (
    <Svg
      xmlns="http://www.w3.org/2000/svg"
      xmlnsXlink="http://www.w3.org/1999/xlink"
      width={18}
      height={18}
      viewBox="0 0 10 10"
      {...props}
    >
      <Image
        width={10}
        height={10}
        xlinkHref="data:image/png;base64,"
      />
    </Svg>
  )
}

